import React from 'react';

const Navbar = () => {
    return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}} className='f3 link dim red pa3 pointer'>
               <p className='f3 link white-80 hover-red'>About</p>
               <p className='f3 link dim white pa2 pointer'>Projects</p>
               <p className='f3 link dim white pa2 pointer'>Socials</p>
        </nav>
    );
}

export default Navbar;
